import React from 'react';
import { FaUserCircle } from 'react-icons/fa';

const AdminNavbar = () => {
  return (
    <header className="bg-white dark:bg-gray-900 shadow-md p-4 flex justify-between items-center px-6">
      {/* Logo & Title */}
      <h1 className="text-2xl font-bold text-blue-700 dark:text-white tracking-tight">
        Admin Dashboard
      </h1>

      {/* Right side (admin info or dropdown) */}
      <div className="flex items-center gap-3 text-gray-700 dark:text-gray-300 text-sm">
        <span className="hidden sm:inline">Welcome, Admin</span>
        <FaUserCircle className="text-2xl text-blue-600 dark:text-white" />
      </div>
    </header>
  );
};

export default AdminNavbar;
